I used the following query to retrieve this information:
`SELECT ?coachingPosition ?coachingPositionLabel ?person ?personLabel 
WHERE {  
  ?person wdt:P39 ?coachingPosition. 
  BIND(wd:Q1434721 AS ?team). 
  SERVICE wikibase:enconcept {
    ?coachingPosition rdfs:label ?coachingPositionLabel.
  }
  FILTER(regex(?coachingPositionLabel, "St.", "i")

regex(?coachingPositionLabel, "Cardinals", "i"))
  BIND(STRAFTER(STR(?person), STR(wd:)) AS ?id)
  SERVICE wikibase:label {
    bd:serviceParam wikibase:language "en".
  }
}`

Please note that this list might not be up-to-date or exhaustive.

