SELECT ?item ?itemLabel 
WHERE {
  ?item wdt:P31 wd:Q11609414 .
  ?item wdt:P20 "Moscow" .
  { SELECT ?item ?itemLabel
    WHERE {?item wdt:P142 ?goldMedal . FILTER (?goldMedal = wd:Q14029 OR ?goldMedal = wd:Q13822 OR ?goldMedal = wd:Q13799 OR ?goldMedal = wd:Q14177)}
  } UNION { SELECT ?item ?itemLabel
    WHERE {?item wdt:P142 ?silverMedal . FILTER (?silverMedal = wd:Q14029 OR ?silverMedal = wd:Q13822 OR ?silverMedal = wd:Q13799 OR ?silverMedal = wd:Q14177)}
  } UNION { SELECT ?item ?itemLabel
    WHERE {?item wdt:P142 ?bronzeMedal . FILTER (?bronzeMedal = wd:Q14029 OR ?bronzeMedal = wd:Q13822 OR ?bronzeMedal = wd:Q13799 OR ?bronzeMedal = wd:Q14177)}
  }
  SERVICE wikibase:label { bd service params: [ "wikibase:labelsAsPropertyIds" ] } 
